import React from "react";
import "semantic-ui-css/semantic.min.css";
import "../css/munchGame.css";
import {} from "semantic-ui-react";

function Game() {
    return (
      <div className = "container">
        <head>
          <link
            href = "https://fonts.googleapis.com/css?family=Almendra SC"
            rel = "stylesheet"
          ></link>
        </head>
        <body className = "gameBackground">
          <h1 className = "glow inGameHeading">Munchkin</h1>
            <div className = "armourSlot" style={{top:'20%', left:'15%'}}/>
            <div className = "armourSlot" style={{top:'40%', left:'15%'}}/>
            <div className = "armourSlot" style={{top:'40%', left:'5%'}}/>
            <div className = "armourSlot" style={{top:'40%', left:'25%'}}/>
            <div className = "armourSlot" style={{top:'60%', left:'15%'}}/>
            <div></div>
        </body>
      </div>
    );
  }

  export default Game;
